import React from 'react';
import {CatagoryFullinfos} from './CatagoryFullinfos';
import CatagoryCard from './CatagoryCard';
import styles from './Catagory.module.css'; // Import the CSS module



function Catagory() {
    return (
        <>
            {CatagoryFullinfos.map((category, index) => (
                <div key={category.name || index} className="category-card">
                    <h2>{category.title}</h2>
                    <img src={category.imgLink} alt={category.title} />
                </div>
            ))}
        </>
    );
}

export default Catagory;
